export default {
  name: "TypeUserDialog",
  data() {
    return {
      list: [],
      listLoading: true,
      pageSize: 10,
      total: 0,
      currentPage: 1,
      userSelectionIndex: null,
    }
  },
  props: {  //接收来自父组件的数据
    userType: {
      type: Number,
      required: true,
    },
    userDialogVisible: {
      type: Boolean
    }
  },
  created() {
    this.getAll()
  },
  methods: {
    getAll() { //getAll函数返回user表中所有的字段赋给list
      this.listLoading = true
      this.$http.get('/user', {   //springwebmvc的自动绑定赋值给service的query方法
        type: this.userType,
        page: this.currentPage - 1,
        size: this.pageSize
      }).then(response => {
        this.list = response.content
        this.total = response.totalElements
        this.listLoading = false
      })
    },
  }
}
